// src/Fluxograma.tsx
import React from 'react';
import ReactFlow, {
  ReactFlowProvider,
  addEdge,
  MiniMap,
  Background,
  Controls,
  Connection,
  Edge,
  Node,
  applyEdgeChanges,
  applyNodeChanges,
} from 'reactflow';
import 'reactflow/dist/style.css';

const OldFluxograma: React.FC = () => {

    return (
        <div className='w-full h-full'>
            <ReactFlow>
                <Background 
                    gap={12}
                    size={12}
                    color='#ddd'
                />
            </ReactFlow>
        </div>
    )
};

export default OldFluxograma;
